import React from 'react';

class App extends React.Component {
  constructor() {
    super ()
    this.State = {lat: null}
    window.navigator.geolocation.getCurrentPosition(
      position => {
        this.setState = ({position})
      },
      err => console.log(err)
    )
  }
  render() {
    return (
      <div>latitude:</div>
    )
  }
}

export default App
